import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate, Link } from 'react-router-dom';
import SignupPage from './components/signup';
import LoginPage from './components/login';
import HomePage from './components/home';
import EventPage from './components/EventPage';
import ResultPage from './components/results';
import ProfilePage from './components/profile';
import Navbar from './components/navbar';

const App = () => {
    const [loggedIn, setLoggedIn] = useState(false);
    const [isAdmin, setIsAdmin] = useState(false);

    // Load login and admin status on mount
    useEffect(() => {
        const isLoggedIn = sessionStorage.getItem("loggedIn") === "true";
        const adminStatus = sessionStorage.getItem("isAdmin") === "true";
        setLoggedIn(isLoggedIn);
        setIsAdmin(adminStatus);
    }, []);

    const handleLogout = () => {
        setLoggedIn(false);
        setIsAdmin(false);
        sessionStorage.removeItem("loggedIn");
        sessionStorage.removeItem("isAdmin");
    };

    const ProtectedRoute = ({ children }) => {
        return loggedIn ? children : <Navigate to="/login" replace />;
    };

    return (
        <Router>
            <div className="app-container">
                <Navbar 
                    loggedIn={loggedIn} 
                    isAdmin={isAdmin} 
                    onLogout={handleLogout} 
                />
                <div className="main-content">
                    <Routes>
                        {/* Default route */}
                            <Route path="/" element={<Navigate to="/login" replace />} />

                        {/* Public routes */}
                        <Route path="/signup" element={<SignupPage />} />
                        <Route path="/login" element={<LoginPage setLoggedIn={setLoggedIn} />} />

                        {/* Protected routes */}
                        <Route path="/home" element={<ProtectedRoute><HomePage /></ProtectedRoute>} />
                        <Route path="/events" element={<ProtectedRoute><EventPage /></ProtectedRoute>} />
                        <Route path="/results" element={<ProtectedRoute><ResultPage /></ProtectedRoute>} />
                        <Route path="/profile" element={<ProtectedRoute><ProfilePage /></ProtectedRoute>} />

                        {/* Admin-only routes */}
                        
                    </Routes>
                </div>
                <footer>
                    <div className="footer-section">
                        <h3>Athletyics</h3>
                        <p>Hi !</p>
                        <p>Welcome to Athletyics</p>
                        <p>
                            Empowering athletes, connecting communities, and celebrating the spirit of sports.
                        </p>
                    </div>
                    <div className="footer-section">
                        <h3>Links</h3>
                        <ul>
                            <li><Link to="/home">Home</Link></li>
                            <li><Link to="/events">Events</Link></li>
                            <li><Link to="/registrations">Registrations</Link></li>
                            <li><Link to="/results">Results</Link></li>
                            <li><Link to="/news">News</Link></li>
                        </ul>
                    </div>
                    <div className="footer-section">
                        <h3>Account</h3>
                        <ul>
                            <li><Link to="/profile">Profile</Link></li>
                            <li><button onClick={handleLogout}>Logout</button></li>
                            <li><Link to="/login">Login</Link></li>
                            <li><Link to="/signup">Signup</Link></li>
                        </ul>
                    </div>
                </footer>
            </div>
        </Router>
    );
};

export default App;
